description:
As Aaliyah gets in bed for a quick afternoon nap she had no idea her pool man was watching her just outside of her window. Just as she passed out he let himself in the front door to see how much he could get away with without waking her up. All I know is maybe its time to look into being a pool man I bet those guys have some great benefits.

